import React from "react";
import "./SkillsContainer.css";
import { makeStyles } from '@material-ui/core/styles';

import Card from "@material-ui/core/Card";
import CardActions from "@material-ui/core/CardActions";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography"
import Paper from "@material-ui/core/Paper";
import Chip from "@material-ui/core/Chip";

const useStyles = makeStyles(theme=>({
    root: {
        maxWidth: 275,
    },
    skillContainer:{
        display:'flex',
        justifyContent:'center',
        flexWrap:'wrap',
        listStyle:'none',
        // padding: theme.spacing(0.5),
        margin:0,
    },
    skill:{
        margin:theme.spacing(0.5),
        border:'1px solid rgba(0,0,0,0.5)',
    },  
    title: {
        fontSize: 14,
    },
    body: {
        fontSize: 12,
    }
}))
export default function Skill(props) {
    const classes = useStyles();
    // const [cardTitle, setCardTitle] = React.useState([
    //     {key:0, label: "Web Development"},
    //     {key:1, label: "Personal Skills"},
    // ])
    // const [webSkillData, setWebSkillData] = React.useState([
    //      {key: 0, label: 'React'} ,
    //      {key: 1, label: 'SCSS'} ,
    // ])
    // const [personalSkillData, setPersonalSkillData]= React.useState([
    //     {key:0,label:"Leadership"},
    //     {key:1, label:"Grit"}
    // ])
    return (
        <Card className={classes.root}>
            <CardContent>
                <Typography className={classes.title} color="textPrimary" gutterBottom>
                    {props.title}
                </Typography>
                <Paper component="ul" className={classes.skillContainer}>
                    {props.skills.map(data => {
                        console.log(data);
                        return (
                            <li key={data.key}>
                                <Chip
                                    label={data.value}
                                    className={classes.skill}
                                />
                            </li>
                        );
                    })}
                </Paper>
            </CardContent>
        </Card>
    );
}
